// DeploymentServiceHandler is an implementation of the
// obiente.cloud.deployments.v1.DeploymentService service.
type DeploymentServiceHandler interface {
	// List organization deployments
	ListDeployments(context.Context, *connect.Request[v1.ListDeploymentsRequest]) (*connect.Response[v1.ListDeploymentsResponse], error)
	// Create new deployment
	CreateDeployment(context.Context, *connect.Request[v1.CreateDeploymentRequest]) (*connect.Response[v1.CreateDeploymentResponse], error)
	// Get deployment details
	GetDeployment(context.Context, *connect.Request[v1.GetDeploymentRequest]) (*connect.Response[v1.GetDeploymentResponse], error)
	// Update deployment configuration
	UpdateDeployment(context.Context, *connect.Request[v1.UpdateDeploymentRequest]) (*connect.Response[v1.UpdateDeploymentResponse], error)
	// Trigger deployment
	TriggerDeployment(context.Context, *connect.Request[v1.TriggerDeploymentRequest]) (*connect.Response[v1.TriggerDeploymentResponse], error)
	// Stream deployment status updates
	StreamDeploymentStatus(context.Context, *connect.Request[v1.StreamDeploymentStatusRequest], *connect.ServerStream[v1.DeploymentStatusUpdate]) error
	// Get deployment logs
	GetDeploymentLogs(context.Context, *connect.Request[v1.GetDeploymentLogsRequest]) (*connect.Response[v1.GetDeploymentLogsResponse], error)
	// Stream deployment logs (tail/follow)
	StreamDeploymentLogs(context.Context, *connect.Request[v1.StreamDeploymentLogsRequest], *connect.ServerStream[v1.DeploymentLogLine]) error
	// Stream build logs during deployment (live build output)
	StreamBuildLogs(context.Context, *connect.Request[v1.StreamBuildLogsRequest], *connect.ServerStream[v1.DeploymentLogLine]) error
	// Get deployment metrics (real-time or historical)
	GetDeploymentMetrics(context.Context, *connect.Request[v1.GetDeploymentMetricsRequest]) (*connect.Response[v1.GetDeploymentMetricsResponse], error)
	// Stream real-time deployment metrics
	StreamDeploymentMetrics(context.Context, *connect.Request[v1.StreamDeploymentMetricsRequest], *connect.ServerStream[v1.DeploymentMetric]) error
	// Get aggregated usage for a deployment
	GetDeploymentUsage(context.Context, *connect.Request[v1.GetDeploymentUsageRequest]) (*connect.Response[v1.GetDeploymentUsageResponse], error)
	// Start a stopped deployment
	StartDeployment(context.Context, *connect.Request[v1.StartDeploymentRequest]) (*connect.Response[v1.StartDeploymentResponse], error)
	// Stop a running deployment
	StopDeployment(context.Context, *connect.Request[v1.StopDeploymentRequest]) (*connect.Response[v1.StopDeploymentResponse], error)
	// Delete a deployment
	DeleteDeployment(context.Context, *connect.Request[v1.DeleteDeploymentRequest]) (*connect.Response[v1.DeleteDeploymentResponse], error)
	// Restart a deployment
	RestartDeployment(context.Context, *connect.Request[v1.RestartDeploymentRequest]) (*connect.Response[v1.RestartDeploymentResponse], error)
	// Scale a deployment
	ScaleDeployment(context.Context, *connect.Request[v1.ScaleDeploymentRequest]) (*connect.Response[v1.ScaleDeploymentResponse], error)
	// Get deployment environment variables
	GetDeploymentEnvVars(context.Context, *connect.Request[v1.GetDeploymentEnvVarsRequest]) (*connect.Response[v1.GetDeploymentEnvVarsResponse], error)
	// Update deployment environment variables
	UpdateDeploymentEnvVars(context.Context, *connect.Request[v1.UpdateDeploymentEnvVarsRequest]) (*connect.Response[v1.UpdateDeploymentEnvVarsResponse], error)
	// Get deployment docker compose configuration
	GetDeploymentCompose(context.Context, *connect.Request[v1.GetDeploymentComposeRequest]) (*connect.Response[v1.GetDeploymentComposeResponse], error)
	// Validate deployment docker compose configuration (validation only, no save)
	ValidateDeploymentCompose(context.Context, *connect.Request[v1.ValidateDeploymentComposeRequest]) (*connect.Response[v1.ValidateDeploymentComposeResponse], error)
	// Update deployment docker compose configuration
	UpdateDeploymentCompose(context.Context, *connect.Request[v1.UpdateDeploymentComposeRequest]) (*connect.Response[v1.UpdateDeploymentComposeResponse], error)
	// GitHub integration
	// List GitHub repositories for the authenticated user
	ListGitHubRepos(context.Context, *connect.Request[v1.ListGitHubReposRequest]) (*connect.Response[v1.ListGitHubReposResponse], error)
	// Get branches for a GitHub repository
	GetGitHubBranches(context.Context, *connect.Request[v1.GetGitHubBranchesRequest]) (*connect.Response[v1.GetGitHubBranchesResponse], error)
	// Get file content from a GitHub repository
	GetGitHubFile(context.Context, *connect.Request[v1.GetGitHubFileRequest]) (*connect.Response[v1.GetGitHubFileResponse], error)
	// Build history management
	// List builds for a deployment
	ListBuilds(context.Context, *connect.Request[v1.ListBuildsRequest]) (*connect.Response[v1.ListBuildsResponse], error)
	// Get details of a specific build
	GetBuild(context.Context, *connect.Request[v1.GetBuildRequest]) (*connect.Response[v1.GetBuildResponse], error)
	// Get build logs for a specific build
	GetBuildLogs(context.Context, *connect.Request[v1.GetBuildLogsRequest]) (*connect.Response[v1.GetBuildLogsResponse], error)
	// Revert deployment to a previous build
	RevertToBuild(context.Context, *connect.Request[v1.RevertToBuildRequest]) (*connect.Response[v1.RevertToBuildResponse], error)
	// Delete a build from history
	DeleteBuild(context.Context, *connect.Request[v1.DeleteBuildRequest]) (*connect.Response[v1.DeleteBuildResponse], error)
	// List all available GitHub integrations for the current user
	ListAvailableGitHubIntegrations(context.Context, *connect.Request[v1.ListAvailableGitHubIntegrationsRequest]) (*connect.Response[v1.ListAvailableGitHubIntegrationsResponse], error)
	// Terminal access
	// Stream terminal with bidirectional streaming (replaces StreamTerminalOutput + SendTerminalInput)
	// Use this for better input/output synchronization
	StreamTerminal(context.Context, *connect.BidiStream[v1.TerminalInput, v1.TerminalOutput]) error
	// DEPRECATED: Use StreamTerminal instead for bidirectional streaming
	// Stream terminal output from a deployment container
	// Input is sent via SendTerminalInput RPC
	StreamTerminalOutput(context.Context, *connect.Request[v1.StreamTerminalOutputRequest], *connect.ServerStream[v1.TerminalOutput]) error
	// DEPRECATED: Use StreamTerminal instead for bidirectional streaming
	// Send input to an active terminal session
	SendTerminalInput(context.Context, *connect.Request[v1.SendTerminalInputRequest]) (*connect.Response[v1.SendTerminalInputResponse], error)
	// File browser
	// List files in a deployment container
	ListContainerFiles(context.Context, *connect.Request[v1.ListContainerFilesRequest]) (*connect.Response[v1.ListContainerFilesResponse], error)
	// Get file content from a deployment container
	GetContainerFile(context.Context, *connect.Request[v1.GetContainerFileRequest]) (*connect.Response[v1.GetContainerFileResponse], error)
	// Upload files to a deployment container
	UploadContainerFiles(context.Context, *connect.Request[v1.UploadContainerFilesRequest]) (*connect.Response[v1.UploadContainerFilesResponse], error)
	// Chunk-based file upload for deployment containers using shared payloads
	ChunkUploadContainerFiles(context.Context, *connect.Request[v1.ChunkUploadContainerFilesRequest]) (*connect.Response[v1.ChunkUploadContainerFilesResponse], error)
	// Delete one or more files/directories in a deployment container
	DeleteContainerEntries(context.Context, *connect.Request[v1.DeleteContainerEntriesRequest]) (*connect.Response[v1.DeleteContainerEntriesResponse], error)
	// Rename or move a file/directory within a deployment container
	RenameContainerEntry(context.Context, *connect.Request[v1.RenameContainerEntryRequest]) (*connect.Response[v1.RenameContainerEntryResponse], error)
	// Create an empty file or directory within a deployment container
	CreateContainerEntry(context.Context, *connect.Request[v1.CreateContainerEntryRequest]) (*connect.Response[v1.CreateContainerEntryResponse], error)
	// Write/update file contents in a deployment container
	WriteContainerFile(context.Context, *connect.Request[v1.WriteContainerFileRequest]) (*connect.Response[v1.WriteContainerFileResponse], error)
	// Extract a zip file to a destination directory
	ExtractDeploymentFile(context.Context, *connect.Request[v1.ExtractDeploymentFileRequest]) (*connect.Response[v1.ExtractDeploymentFileResponse], error)
	// Create a zip archive from files or folders
	CreateDeploymentFileArchive(context.Context, *connect.Request[v1.CreateDeploymentFileArchiveRequest]) (*connect.Response[v1.CreateDeploymentFileArchiveResponse], error)
	// Routing configuration
	// Get all routing rules for a deployment
	GetDeploymentRoutings(context.Context, *connect.Request[v1.GetDeploymentRoutingsRequest]) (*connect.Response[v1.GetDeploymentRoutingsResponse], error)
	// Update routing rules for a deployment (replaces all existing rules)
	UpdateDeploymentRoutings(context.Context, *connect.Request[v1.UpdateDeploymentRoutingsRequest]) (*connect.Response[v1.UpdateDeploymentRoutingsResponse], error)
	// Get available service names from Docker Compose
	GetDeploymentServiceNames(context.Context, *connect.Request[v1.GetDeploymentServiceNamesRequest]) (*connect.Response[v1.GetDeploymentServiceNamesResponse], error)
	// Domain verification
	// Get verification token for a custom domain
	GetDomainVerificationToken(context.Context, *connect.Request[v1.GetDomainVerificationTokenRequest]) (*connect.Response[v1.GetDomainVerificationTokenResponse], error)
	// Verify domain ownership via DNS TXT record
	VerifyDomainOwnership(context.Context, *connect.Request[v1.VerifyDomainOwnershipRequest]) (*connect.Response[v1.VerifyDomainOwnershipResponse], error)
	// List all containers for a deployment
	ListDeploymentContainers(context.Context, *connect.Request[v1.ListDeploymentContainersRequest]) (*connect.Response[v1.ListDeploymentContainersResponse], error)
	// Stream logs from a specific container
	StreamContainerLogs(context.Context, *connect.Request[v1.StreamContainerLogsRequest], *connect.ServerStream[v1.DeploymentLogLine]) error
	// Start a specific container
	StartContainer(context.Context, *connect.Request[v1.StartContainerRequest]) (*connect.Response[v1.StartContainerResponse], error)
	// Stop a specific container
	StopContainer(context.Context, *connect.Request[v1.StopContainerRequest]) (*connect.Response[v1.StopContainerResponse], error)
	// Restart a specific container
	RestartContainer(context.Context, *connect.Request[v1.RestartContainerRequest]) (*connect.Response[v1.RestartContainerResponse], error)
}

